import React from 'react'

import './Nav.css'
import Video from './Video'

export const AdminVideo = ({state}) => {

    const allVideo=Object.keys(state.video)
                .map(items =>
                    <Video key={items} 
                           video={state.video[items].nom}/>
                )
   
    return (
        <div className='cards'>
           {allVideo}
        </div>
    )
}


export default AdminVideo
